<script type="text/javascript">
        $(document).ready(function () {
            if (window.IsDuplicate()) {
                swal("Oops", "This is a duplicate window\n\n Please close this window/tab...", "error");
                window.close();
            }
        });
        function OnItemClick(s, e) {
            if (e.item.name.startsWith("MenuLogin")) {
                e.processOnServer = false;
                pcLogin.Show();
            }
            if (e.item.name.startsWith("MenuOnlyLinked")) {
                e.processOnServer = false;
                popupControlLinkedAreSure.Show();
            }
        }

        // Create cookie
        function setCookie(cname, cvalue, exdays) {
            const d = new Date();
            d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
            let expires = "expires=" + d.toUTCString();
            document.cookie = cname + "=" + cvalue + ";" + expires + ";path=/";
        }

        // Delete cookie
        function deleteCookie(cname) {
            const d = new Date();
            d.setTime(d.getTime() + (24 * 60 * 60 * 1000));
            let expires = "expires=" + d.toUTCString();
            document.cookie = cname + "=;" + expires + ";path=/";
        }

        // Read cookie
        function getCookie(cname) {
            let name = cname + "=";
            let decodedCookie = decodeURIComponent(document.cookie);
            let ca = decodedCookie.split(';');
            for (let i = 0; i < ca.length; i++) {
                let c = ca[i];
                while (c.charAt(0) == ' ') {
                    c = c.substring(1);
                }
                if (c.indexOf(name) == 0) {
                    return c.substring(name.length, c.length);
                }
            }
            return "";
        }

        // Set cookie consent
        function acceptCookieConsent() {
            deleteCookie('pmd_user_cookie_consent');
            setCookie('pmd_user_cookie_consent', 1, 30);
            document.getElementById("cookieNotice").style.display = "none";
        }
        // Set cookie consent
        function rejectCookieConsent() {
            deleteCookie('pmd_user_cookie_consent');
            setCookie('pmd_user_cookie_consent', 0, 30);
            document.getElementById("cookieNotice").style.display = "none";
        }

    </script>
